import './App.css';
import React, { useState } from 'react';

function App(props) {

  const [count, setCount] = useState(0);

  function Escondidinho(){
    return (
      <h1> Apareci </h1>
    )
  }

  return (
    <div className="App">
      <h1>
        Count = {count}
      </h1>
      <button onClick = {() => setCount(count + 1)}>
        +
      </button>      
      <button onClick = {() => setCount(count - 1)}>
        -
      </button>
      <br/>
      <button>
        Escondidinho
      </button>          
    </div>
  );

}



export default App;
